const Header = () => {
    return (
        <div className="container text-center py-5">
            <h1 className="display-4 fw-bold">Hello, world!</h1>
            <p className="lead">
                Hello User, welcome to <strong>EShop</strong>, your one-stop solution for all your needs.
            </p>
            <hr className="my-4" />
            <p>
                We use utility classes for typography and spacing to create a seamless shopping experience.
            </p>
            <a className="btn btn-primary btn-lg" href="#" role="button">
                Start Shopping
            </a>
        </div>
    );
};

export default Header;
